INSERT INTO `t_page` (`id`, `page_title`, `description`, `content`, `image_banner`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(1, 'Sejarah', 'Halaman Sejarah', '<p style=\"text-align:justify\">Sejarah SESPIM berawal pada tanggal 24 September 1964. SESPIM POLRI sebagai lembaga pendidikan Kepemimpinan dan Manajemen, berdiri dan diresmikan oleh Presiden Republik Indonesia Ir. Soekarno di Istana Bogor pada tanggal 19 Maret 1965. Didalam perjalanannya SESPIM Polri mengalami beberapa perubahan :</p>\r\n\r\n<p>Pada tanggal 19 Maret 1965 angkatan satu dibuka dengan sebutan Sekolah Staf dan Komando Angkatan Kepolisian (SESKOAK)</p>\r\n\r\n<ol>\r\n	<li>Tanggal 1 Juli 1969 (SESKOAK) menjadi Sekolah Staf dan komando angkatan Kepolisian (SESKOPOL)</li>\r\n	<li>Tahun 1974 Seskopol Berubah menjadi Sesko ABRI bagian Kepolisian.</li>\r\n	<li>Tanggal 30 Oktober 1984, Sesko ABRI bagian Kepolisian dirubah menjadi Sespim Polri</li>\r\n	<li>Tanggal 25 Mei 2001 Sespim Polri berada dibawah Dediklat Kapolri</li>\r\n	<li>Tanggal 17 Oktober 2002 Sespim Polri kembali keberadaannya langsung berada dibawah Kapolri</li>\r\n	<li>Tanggal 14 september 2010&nbsp; seluruh lembaga pendidikan Polri berada dibawah Lemdikpol.</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\">Selanjutnya Nomenklatur &ldquo;Lemdikpol&rdquo; berubah menjadi &ldquo;Lembaga Pendidikan dan Latihan Polri&rdquo; yang disingkat Lemdiklat Polri, Didasari dari Peraturan Presiden Republik Indonesia Nomor Tahun 5 tahun 2017 tentang Perubahan atas Peraturan Presiden Nomor 52 Tahun 2010 Tentang susunan Organisasi Tata Kerja Kepolisian Negara Republik</p>\r\n\r\n<p style=\"text-align:justify\">Sespim Polri mengembangkan kerjasama dengan menerima peserta dari Instansi lain seperti TNI meliputi Angkatan Darat, Angkatan Laut dan Angkatan Udara serta dari unsur Criminal Justice System dan juga peserta didik dari mancanegara. Alumni mancanegara sampai saat ini berjumlah 113 orang dari 14 negara, yaitu : Arab Saudi, Malaysia, Nigeria, Papua New Guinea, Madagaskar, Brunei Darussalam, Philipina, Thailand, Singapura, Timor Leste, Kamboja, Rumania, Monzambik,dan Fiji.</p>\r\n\r\n<p style=\"text-align:justify\">Dari semua uraian tentang tugas, fungsi dan tujuan lembaga pendidikan Sespim Polri adalah menghasilkan Perwira Polri yang Profesional Modern Terpercaya yang mampu melaksanakan tugas selaku Manager pada tingkat pertama, Tingkat menengah dan tingkat tinggi sesuai dengan jenjang pendidikan para Peserta Didik, yang kelak akan menjadi Pemimpin sebuah organisasi baik pada Polri atau Instansi lainnya.</p>', '1678260833_product-img-1.jpg', '2023-03-08 07:33:53', 'admin', '2023-03-12 08:45:32', 'admin'),
(2, 'Profil', 'Halaman Profil', '<h3><strong>Profil</strong></h3\n<p><span style=\"font-family:&quot;Times New Roman&quot;\"><span style=\"font-size:12,0000pt\"><span style=\"font-family:Arial\"><span style=\"color:#222222\">Lembaga Pendidikan dan Pelatihan Kepolisian Negara Republik Indonesia</span></span></span><span style=\"font-size:12,0000pt\"><span style=\"background-color:#ffffff\"><span style=\"font-family:Arial\"><span style=\"color:#222222\">&nbsp;disingkat&nbsp;</span></span></span></span><span style=\"font-size:12,0000pt\"><span style=\"font-family:Arial\"><span style=\"color:#222222\">Lemdiklat Polri</span></span></span><span style=\"font-size:12,0000pt\"><span style=\"background-color:#ffffff\"><span style=\"font-family:Arial\"><span style=\"color:#222222\">, adalah lembaga pendidikan kedinasan dan akademik di bawah kendali&nbsp;</span></span></span></span><a href=\"https://id.wikipedia.org/wiki/Kapolri\" title=\"Kapolri\"><span style=\"font-size:12,0000pt\"><span style=\"font-family:Arial\"><span style=\"color:#0b0080\">Kapolri</span></span></span></a><span style=\"font-size:12,0000pt\"><span style=\"background-color:#ffffff\"><span style=\"font-family:Arial\"><span style=\"color:#222222\">. Tugas pokok Lemdiklat Polri adalah merencanakan, mengembangkan, dan menyelenggarakan fungsi pendidikan pembentukan dan pengembangan, berdasarkan jenis pendidikan Polri yang meliputi pendidikan profesi, manajerial akademis, dan vokasi, serta mengelola komponen pendidikan di lingkungan&nbsp;</span></span></span></span><a href=\"https://id.wikipedia.org/wiki/Polri\" title=\"Polri\"><span style=\"font-size:12,0000pt\"><span style=\"font-family:Arial\"><span style=\"color:#0b0080\">Polri</span></span></span></a></span></p>\n\n<p><span style=\"font-family:&quot;Times New Roman&quot;\"><span style=\"font-size:12,0000pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Salah satu lembaga pendidikan pengembangan, yaitu Sekolah Staf dan Pimpinan Polri atau disingkat Sespim Lemdiklat Polri. Sespim Lemdiklat Polri adalah lembaga pendidikan Polri yang menyelenggarakan pendidikan manajemen untuk &nbsp;membentuk calon pimpinan Polri mulai tingkat Pertama, &nbsp;Menengah, dan Tinggi. Selain itu Sespim Polri </span></span></span><span style=\"font-size:12,0000pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">melaksanakan pengkajian dan pengembangan kebijakan serta mengelola komponen pendidikan di lingkungan Polri.</span></span></span></span></p>\n\n<h3><strong>Visi &amp; Misi</strong></h3>\n\n<p><span style=\"font-family:&quot;Times New Roman&quot;\"><span style=\"font-size:12,0000pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Visi Sespim Lemdiklat Polri adalah, menjadi lembaga pendidikan pengembangan tinggi Polri yang berkualitas, dalam mendidik calon pimpinan Polri yang memiliki profesionalisme, wawasan kepemimpinan strategi dan komitmen kuat terhadap integritas moral sebagai pelindung pengayom dan pelayan masyarakat.</span></span></span></span></p>\n\n<p>Misi SESPIM LEMDIKLAT POLRI :</p>\n\n<ul>\n	<li>\n	<p style=\"text-align:justify\"><span style=\"font-family:Calibri\"><span style=\"font-size:10,5000pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Menyelenggarakan pendidikan calon pemimpin untuk tingkat pertama, tingkat menengah, dan tingkat tinggi polri juga untuk penegak hukum lainnya</span></span></span></span></p>\n	</li>\n	<li>\n	<p style=\"text-align:justify\"><span style=\"font-family:Calibri\"><span style=\"font-size:10,5000pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Menyelenggarakan pengkajian dan pengembangan, kebijakan dan strategi kepolisian, peradilan pidana, keamanan dan ketertiban masyarakat.</span></span></span></span></p>\n	</li>\n	<li>\n	<p style=\"text-align:justify\"><span style=\"font-family:Calibri\"><span style=\"font-size:10,5000pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Menyelenggarakan pelayanan informasi hasil pengkajian dan pengembangan, konsultasi manajemen kepolisian, keamanan dan ketertiban masyarakat.</span></span></span></span></p>\n	</li>\n	<li>\n	<p style=\"text-align:justify\"><span style=\"font-family:Calibri\"><span style=\"font-size:10,5000pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Menyelenggarakan pendidikan lainnya dibidang manajemen keamanan dan ketertiban masyarakat.</span></span></span></span></p>\n	</li>\n</ul>', '1678261662_product-img-1.jpg', '2023-03-08 07:47:42', 'admin', NULL, ''),
(3, 'Struktur', 'Halaman Struktur', '<p>Halaman Struktur</p>', NULL, '2023-03-12 04:21:45', 'admin', NULL, NULL),
(4, 'Kurikulum', 'Halaman Kurikulum', '<p>Halaman Kurikulum</p>', '1678596954_1.jpeg', '2023-03-12 04:22:26', 'admin', '2023-03-12 04:55:54', 'admin');

