(5, 1, 1, 'Pemanfaatan Sumber Daya Alam di Lingkungan Sespim Lemdiklat Polri berpotensi besar untuk dikembangkan', NULL, 'pemanfaatan-sumber-daya-alam-di-lingkungan-sespim-lemdiklat-polri-berpotensi-besar-untuk-dikembangkan', 'summary', '<p style=\"text-align:justify\">Sumber mata air di lingkungan Sespim Lemdiklat Polri, yaitu di Gadog 1 dan Gadog 2 dilakukan pembenahan dan pembangunan mulai dari akses jalan, lokasi mata air, area pemandian, penampungan air, pengolahan air bersih, dan lain sebagainnya. Pengembangan potensi sumber daya alam yang ada di lingkungan Sespim Lemdiklat Polri tentu bermanfaat bagi Lingkungan, juga dapat menjadi lokasi wisata terbatas yang bisa di nikmati masyarakat umum.</p>\n\n<p style=\"text-align:justify\">Lingkungan Pendidikan yang nyaman, asri dan ngangenin menjadi dasar ide gagasan Kasespim Lemdiklat Polri untuk mengembangkan potensi sumber daya yang ada seperti sumber mata air Gadog 1 dan Gadog 2. Upaya ini juga sebagai implementasi Program Bapak Kalemdiklat Polri.</p>', 'bg.jpeg', 1, '2023-03-12 03:44:21', 'admin', '2023-03-11 22:07:57', 'admin');
INSERT INTO `t_post` (`id`, `author_id`, `category_id`, `title`, `meta_title`, `slug`, `summary`, `content`, `image_banner`, `published`, `created_at`, `created_by`, `updated_at`, `updated_by`) VALUES
(8, 1, 1, 'Sespim Lemdiklat Polri tata Lingkungan untuk mendukung kegiatan Pendidikan', NULL, 'sespim-lemdiklat-polri-tata-lingkungan-untuk-mendukung-kegiatan-pendidikan', NULL, '<p><img src=\"data:image/png;base64,\" style=\"height:160px; width:200px\" /><img src=\"data:image/png;base64,\" style=\"height:160px; width:200px\" /><img src=\"data:image/png;base64,\" style=\"height:160px; width:200px\" /></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:Calibri\"><span style=\"font-family:\'Times New Roman\'\">Lingkungan Sespim Lemdiklat Polri tampak berwarna warni bunga di setiap sudut. Tata ruang hijau bukan hanya indah dipandang, tetapi juga menambah segar dan sejuk udara di Lingkungan sekitar. Selain tanaman yang mempercantik Lokasi Sespim Lemdiklat Polri, tampak juga Sebagian dinding pada ruangan yang dipenuhi dengan kalimat-kalimat motivasi Kepemimpinan dan ikon Nusantara.</span></span></span></p>\r\n\r\n<p><img src=\"data:image/png;base64,\" style=\"height:160px; width:200px\" /><img src=\"data:image/png;base64,\" style=\"height:160px; width:200px\" /><img src=\"data:image/png;base64,\" style=\"height:160px; width:200px\" /></p>\r\n\r\n<p><span style=\"font-size:16px\"><span style=\"font-family:Calibri\"><span style=\"font-family:\'Times New Roman\'\">Penataan lingkungan ini adalah sebagai upaya mendukung proses Pendidikan di Sespim Lemdiklat Polri menuju Kampus tempat Favorit dan Personel yang Prestasi, sesuai Program Kalemdiklat Polri.</span></span></span></p>', '1678603603_WhatsApp Image 2023-03-09 at 11.31.41.jpeg', 1, '2023-03-12 06:46:43', 'admin', '2023-03-11 23:50:49', 'admin');
